import React, { Component } from 'react'

class User extends Component {
  render(props) {

    return (
      <div>
        <ul>
          <li>NAme: paul</li>
          <li>department: Physic </li>
          <li> Salary: 1.2 m</li>
        </ul>
        <p> {props.data4UserComp}</p>
      </div>
    )

  }
}


export default User;
